import Navigation from '../components/Navigation.';
import DisplayArticle from '../components/DisplayArticle';
import CreateComment from '../components/CreateComment';
// Page Articles
const Article = () => {
  return (
    <div className='DisplayArticle'>
      <Navigation />
      <DisplayArticle />
      <CreateComment />
    </div>
  );
};
export default Article;
